import React from 'react';
import { Link } from 'react-router-dom';
import { NotFoundContainer } from './NotFound.styles.js';

const NotFound = () => {
  return (
    <NotFoundContainer>
      <h2>Thank you for shopping with us</h2>
      <h3>
        <Link to="/shop">Forgot something?</Link>
      </h3>
    </NotFoundContainer>
  );
};

export default NotFound;
